//import logo from './logo.svg';
// import PopChat from "./component/Popchat.js";
import PopChat from "./component/Popchat";
import "./App.css";
import { useState } from "react";

function App() {
  const { messages, setMessages } = useState([
    "hggjmnb",
    "hggvjhghgj",
    "hello",
    "world",
  ]);

  const getMessage = (value) => {
    setMessages(messages.push(value))
  }

  console.log("dssd");
  return <PopChat messages={messages} getMessages={getMessages} />;
}

export default App;
